import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function AddPatient() {
	const navigate = useNavigate();
	const [patient, setPatient] = useState({ name: '', gender: '', age: '', contact: '', address: '' });

	const handleChange = (e) => {
		setPatient({ ...patient, [e.target.name]: e.target.value });
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		await axios.post('http://localhost:8080/api/patients', patient);
		navigate('/');
	};

	return (
		<form onSubmit={handleSubmit}>
			<div className="mb-3">
				<label>Name</label>
				<input className="form-control" name="name" value={patient.name} onChange={handleChange} required />
			</div>
			<div class="dropdown">
				<button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
					Dropdown button
				</button>
				<div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
					<a class="dropdown-item">Action</a>
					<a class="dropdown-item" href="#">Another action</a>
					<a class="dropdown-item" href="#">Something else here</a>
				</div>
			</div>
			{/* <div className="mb-3">
        <label>Gender</label>
        <input className="form-control" name="gender" value={patient.gender} onChange={handleChange} required />
      </div> */}
			<div className="mb-3">
				<label>Age</label>
				<input className="form-control" name="age" value={patient.age} onChange={handleChange} required />
			</div>
			<div className="mb-3">
				<label>Contact</label>
				<input className="form-control" name="contact" value={patient.contact} onChange={handleChange} required />
			</div>
			<div className="mb-3">
				<label>Address</label>
				<input className="form-control" name="address" value={patient.address} onChange={handleChange} required />
			</div>
			<button className="btn btn-success" type="submit">Save</button>
		</form>
	);
}

export default AddPatient;
